import React from 'react';
import FadeIn from 'react-fade-in';
import "../styles/research.css"

const Publication = ({year, title, authors, location}) => {
  return (
    <div class="publication">
      <p class="year">{year}</p>
      <div>
        <p class="title">The Gopher's Gambit: Survival Advantages of Artifact-Based Intention Perception.</p>
        <p class="authors">Cynthia Hom, <b>Amani Maina-Kilaas</b>, Kevin Ginta, Cindy Lay, and George Monta&ntilde;ez</p>
        <p class="location">13th International Conference on Agents and Artificial Intelligence</p>
      </div>
    </div>
  );
}

const Research = () => {
  return (
    <div id="research-div">
      <h1>Research</h1>
      <Publication 
        year="2021" 
        title="The Gopher's Gambit: Survival Advantages of Artifact-Based Intention Perception." />
    </div>
  );
}

export default Research;
